import {Component} from "react";
import React from "react";

class StorePicker extends Component {


	render() {
		return (
			<React.Fragment>
				<p> Fish! </p>
			<form className="storeselector"> I am the Store Picker Component
			<h2> Please Enter a Store </h2>

			</form>
			</React.Fragment>
		)
	}
}

export default StorePicker
